    "Observations of translocated Aleutian Canada geese following their release at
    Nizki/Alaid Island in August 1990",nt"tracking_summary": {ntt"total":
    2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-06-17T01:57:46.082591",nt"name": "observations-of-translocated-aleutian-canada-geese-following-their-release-at-nizki-alaid-",nt"isopen":
    false,nt"url": null,nt"notes": "Using available information, we estimate
    that 19 of the 20 birds in the first translocated flock were still alive 2 days
    after their release, and at least 8 birds from the second flock were alive 2 days
    after their release. On 2 different occasions, a banded gosling was seen in a large
    flock of geese, at least some of which were not among the translocated birds. Therefore,
    we can conclude that some of the translocated geese were mingling with the resident
    birds. We is recommend that Mallard Pond continue to be used as a release site on
    Nizki because the area immediately surrounding the pond provides good shelter and
    foraging habitat for geese and because of its proximity to Mallard Cove, which provides
    excellent boat access.",nt"license_title": "License Not Specified",nt"extras":
